        not have a real point.","created_at":"2013-05-13T15:40:41.935Z","id":"51910979760ee320eb020fc2","updated_at":"2021-06-23T15:57:21.374Z","url":"https://www.themoviedb.org/review/51910979760ee320eb020fc2"},{"author":"Travis
        Bell","author_details":{"name":"Travis Bell","username":"travisbell","avatar_path":"/xy44UvpbTgzs9kWmp4C3fEaCl5h.png","rating":7.5},"content":"Cloud
        Atlas was a very well made movie but unlike most of the \"simultaneous stories
        that all come together at the end\" type of movies, this one just didn''t.
        I''m still unclear as to the point of it all.\r\n\r\nAnother issue I had was
        a general feeling of goofiness. Sure, the Cavendish story was pure comedy
        but the rest of the stories just didn''t feel serious enough to me.\r\n\r\nIt
        carried my attention for the 172 minutes well enough and it was entertaining.
        I just expected more of a pay off at the end.\r\n\r\nAll in all, it''s definitely
        worth seeing but I still haven''t made up my mind if I truly liked it or not.
        What did you think?","created_at":"2013-08-13T19:46:24.499Z","id":"520a8d10760ee32c8718e6c2","updated_at":"2021-06-23T15:57:22.199Z","url":"https://www.themoviedb.org/review/520a8d10760ee32c8718e6c2"},{"author":"Vlad
        Mihalca","author_details":{"name":"Vlad Mihalca","username":"vlad.mihalca","avatar_path":null,"rating":6.0},"content":"A
        not-easy-to-follow film, we are presented with sub-plots from several times
        and places, both past and future - in which the same characters seem to be
        involved.\r\n\r\nAn interesting idea, good images but yu need to have a particular
        taste in movies in order to fully enjoy Cloud Atlas. I feel that the average
        audience may not be heavily impressed with they way it conveys its message
        - by going from one timeline to another and slowly building up all these sub-plots
        in parallel.","created_at":"2022-01-13T07:46:54.355Z","id":"61dfd8eecb30840098d745dc","updated_at":"2022-01-15T16:15:14.896Z","url":"https://www.themoviedb.org/review/61dfd8eecb30840098d745dc"}],"total_pages":1,"total_results":3}'
